import{_ as i}from"./_plugin-vue_export-helper.cdc0426e.js";import{o as l,c as p,f as a}from"./app.7e7f0dc0.js";const e={},s=a('<h2 id="_2d-\u51E0\u4F55" tabindex="-1"><a class="header-anchor" href="#_2d-\u51E0\u4F55" aria-hidden="true">#</a> 2D \u51E0\u4F55</h2><p>COMSOL Multiphysics<sup>\xAE</sup> \u8F6F\u4EF6\u63D0\u4F9B\u4E86\u5927\u91CF\u7684\u51E0\u4F55\u64CD\u4F5C\u3001\u5DE5\u5177\u6216\u529F\u80FD\u6765\u521B\u5EFA\u4E8C\u7EF4\u51E0\u4F55\u7ED3\u6784\u3002\u8F6F\u4EF6\u4E2D\u5185\u7F6E\u4E86\u53EF\u7528\u4E8E\u6A21\u62DF\u5E38\u89C1\u5F62\u72B6\u7684\u51E0\u4F55\u4F53\uFF0C\u7528\u4E8E\u5B9A\u4E49\u51E0\u4F55\u5C3A\u5BF8\u548C\u4F4D\u7F6E\u7684\u53C2\u6570\u8BBE\u7F6E\uFF0C\u4EE5\u53CA\u53EF\u7528\u4E8E\u6784\u5EFA\u590D\u6742\u51E0\u4F55\u7ED3\u6784\u7684\u5E03\u5C14\u8FD0\u7B97\u3001\u53D8\u6362\u4E0E\u5206\u5272\u51E0\u4F55\u64CD\u4F5C\u3002</p><ul><li>\u60A8\u53EF\u4EE5\u5F88\u8F7B\u677E\u7684\u6DFB\u52A0\u5706\u548C\u77E9\u5F62\u5BF9\u8C61\uFF0C\u4E5F\u53EF\u4EE5\u4F7F\u7528\u53C2\u6570\u66F2\u7EBF\u6216\u591A\u8FB9\u5F62\u5F88\u8F7B\u677E\u7684\u521B\u5EFA\u60A8\u9700\u8981\u7684\u5F62\u72B6\u3002</li><li>\u4F7F\u7528\u5E76\u96C6\u548C\u5DEE\u96C6\u8FD9\u4E24\u79CD\u5E03\u5C14\u8FD0\u7B97\u6765\u521B\u5EFA\u5982\u5706\u73AF\u5F62\u3001\u846B\u82A6\u7684\u51E0\u4F55\u7ED3\u6784\u3002</li><li>\u6267\u884C\u590D\u5236\u3001\u9635\u5217\u548C\u955C\u50CF\u53D8\u6362\u7B49\u64CD\u4F5C\u6765\u5FEB\u901F\u521B\u5EFA\u76F8\u540C\u6216\u76F8\u4F3C\u7684\u7ED3\u5408\u7ED3\u6784\u3002</li></ul><h2 id="\u5C06\u4E8C\u7EF4\u56FE\u5F62\u6269\u5C55\u5230\u4E09\u7EF4" tabindex="-1"><a class="header-anchor" href="#\u5C06\u4E8C\u7EF4\u56FE\u5F62\u6269\u5C55\u5230\u4E09\u7EF4" aria-hidden="true">#</a> \u5C06\u4E8C\u7EF4\u56FE\u5F62\u6269\u5C55\u5230\u4E09\u7EF4</h2><p>COMSOL Multiphysics<sup>\xAE</sup> \u5185\u7F6E\u4E86\u8BB8\u591A\u5F3A\u5927\u7684\u51E0\u4F55\u5DE5\u5177\u3001\u64CD\u4F5C\u548C\u5176\u4ED6\u529F\u80FD\uFF0C\u4E3A\u60A8\u63D0\u4F9B\u591A\u79CD\u65B9\u5F0F\u6765\u521B\u5EFA\u6A21\u578B\u51E0\u4F55\uFF0C\u5176\u4E2D\u5305\u62EC\u4E00\u7CFB\u5217\u5B9A\u5236\u5DE5\u5177\uFF0C\u7528\u4E8E\u6784\u5EFA\u5BF9\u79F0\u51E0\u4F55\u7B49\u7279\u5B9A\u7C7B\u578B\u7684\u51E0\u4F55\u3002</p><p>\u5982\u679C\u4E00\u4E2A\u51E0\u4F55\u5BF9\u8C61\u6CBF\u67D0\u4E2A\u8F74\u5177\u6709\u76F8\u540C\u7684\u6A2A\u622A\u9762\u3002\u6216\u8005\u8BE5\u5BF9\u8C61\u7ED5\u8F74\u5448\u65CB\u8F6C\u5BF9\u79F0\u3002\u53EF\u4EE5\u5148\u521B\u5EFA\u51E0\u4F55\u7684\u6A2A\u622A\u9762\uFF0C\u518D\u5C06\u5176\u6269\u5C55\u6210\u4E09\u7EF4\u5BF9\u8C61\uFF0C\u4ECE\u800C\u5927\u5E45\u63D0\u9AD8\u5EFA\u6A21\u6548\u7387\u3002\u5728 COMSOL Multiphysics \u4E2D\uFF0C\u60A8\u53EF\u4EE5\u57FA\u4E8E\u4E8C\u7EF4\u6A21\u578B\u521B\u5EFA\u4E09\u7EF4\u51E0\u4F55\uFF0C\u65B9\u6CD5\u662F\u4F7F\u7528\u5DE5\u4F5C\u5E73\u9762\u548C\u5E73\u9762\u51E0\u4F55\uFF0C\u7136\u540E\u6267\u884C\u5DE5\u4F5C\u5E73\u9762\u64CD\u4F5C\uFF0C\u4F8B\u5982\u62C9\u4F38\u3001\u65CB\u8F6C\u548C\u626B\u63A0\u7B49\u64CD\u4F5C\u3002</p><ul><li><p>\u62C9\u4F38\u64CD\u4F5C\u7528\u4E8E\u62C9\u4F38\u5DE5\u4F5C\u5E73\u9762\u4E2D\u7684\u5E73\u9762\u6216\u5BF9\u8C61\u3002</p></li><li><p>\u65CB\u8F6C\u64CD\u4F5C\u7528\u4E8E\u7ED5\u4E00\u4E2A\u8F74\u65CB\u8F6C\u5DE5\u4F5C\u5E73\u9762\u4E2D\u7684\u5E73\u9762\u6216\u5BF9\u8C61\uFF0C\u4ECE\u800C\u521B\u5EFA\u4E09\u7EF4\u51E0\u4F55\u3002</p></li><li><p>\u626B\u63A0\u64CD\u4F5C\u7528\u4E8E\u6CBF\u66F2\u7EBF\u626B\u63A0\u5DE5\u4F5C\u5E73\u9762\u4E2D\u7684\u5E73\u9762\u6216\u5BF9\u8C61\uFF0C\u4ECE\u800C\u521B\u5EFA\u4E09\u7EF4\u5B9E\u4F53\u5BF9\u8C61\u3002</p></li></ul><h2 id="\u4E09\u7EF4\u56FE\u50CF" tabindex="-1"><a class="header-anchor" href="#\u4E09\u7EF4\u56FE\u50CF" aria-hidden="true">#</a> \u4E09\u7EF4\u56FE\u50CF</h2><p>\u540C\u4E8C\u7EF4\u56FE\u50CF\u4E00\u6837\uFF0C\u4E09\u7EF4\u56FE\u50CF\u4E5F\u53EF\u4EE5\u4F7F\u7528\u5E76\u96C6\u548C\u5DEE\u96C6\u8FD9\u4E24\u79CD\u5E03\u5C14\u8FD0\u7B97\uFF0C\u5E76\u8FDB\u884C\u590D\u5236\u3001\u9635\u5217\u548C\u955C\u50CF\u53D8\u6362\u7B49\u64CD\u4F5C\u3002\u540C\u65F6\uFF0C\u4E09\u7EF4\u56FE\u50CF\u8FD8\u53EF\u4EE5\u8FDB\u884C\u5206\u5272\u51E0\u4F55\u3002</p><p>\u5206\u5272\u64CD\u4F5C\u53EF\u4EE5\u5206\u79BB\u6A21\u578B\u51E0\u4F55\u7684\u4EFB\u610F\u90E8\u5206\u3002\u8FD9\u4E00\u529F\u80FD\u9002\u7528\u4E8E\u591A\u79CD\u60C5\u51B5\u3002\u4F8B\u5982\uFF0C\u5982\u679C\u60A8\u5E0C\u671B\u62C6\u5206\u5BF9\u8C61\u3001\u57DF\u3001\u8FB9\u754C\u6216\u8FB9\u7B49\u51E0\u4F55\u5B9E\u4F53\uFF0C\u6216\u5E0C\u671B\u4ECE\u6A21\u578B\u4E2D\u79FB\u9664\u4E00\u90E8\u5206\u51E0\u4F55\u5143\u7D20\uFF0C\u8FBE\u5230\u6E05\u7406\u51E0\u4F55\u7ED3\u6784\u6216\u7B80\u5316\u4EFF\u771F\u7684\u76EE\u7684\uFF1B\u6216\u8005\u662F\u5E0C\u671B\u6539\u8FDB\u6A21\u578B\u4E2D\u7684\u7F51\u683C\u5256\u5206\uFF0C\u90FD\u53EF\u4EE5\u4F7F\u7528\u6B64\u529F\u80FD\u3002\u6B64\u529F\u80FD\u5728\u5904\u7406\u7ED3\u6784\u590D\u6742\u6216\u5177\u6709\u9AD8\u7EB5\u6A2A\u6BD4\u7684\u51E0\u4F55\u65F6\u53CA\u5176\u6709\u7528\u3002</p><h2 id="\u57FA\u4E8E\u4E09\u7EF4\u7ED3\u6784\u521B\u5EFA\u4E8C\u7EF4\u6A21\u578B" tabindex="-1"><a class="header-anchor" href="#\u57FA\u4E8E\u4E09\u7EF4\u7ED3\u6784\u521B\u5EFA\u4E8C\u7EF4\u6A21\u578B" aria-hidden="true">#</a> \u57FA\u4E8E\u4E09\u7EF4\u7ED3\u6784\u521B\u5EFA\u4E8C\u7EF4\u6A21\u578B</h2><p>\u5728 COMSOL Multiphysics<sup>\xAE</sup> \u4E2D\uFF0C\u60A8\u53EF\u4EE5\u7ED3\u5408\u4F7F\u7528\u5DE5\u4F5C\u5E73\u9762\u4E0E\u6A2A\u622A\u9762 \u51E0\u4F55\u64CD\u4F5C\uFF0C\u5B9E\u73B0\u57FA\u4E8E\u4E09\u7EF4\u51E0\u4F55\u6765\u521B\u5EFA\u4E8C\u7EF4\u6A21\u578B\u3002\u5229\u7528\u8FD9\u4E00\u529F\u80FD\uFF0C\u60A8\u53EF\u4EE5\u4ECE\u51E0\u4F55\u4E2D\u63D0\u53D6\u6A2A\u622A\u9762\uFF0C\u5E76\u57FA\u4E8E\u4E09\u7EF4\u6A21\u578B\u6765\u521B\u5EFA\u4E8C\u7EF4\u6A21\u578B\uFF0C\u4ECE\u800C\u5927\u5E45\u7F29\u77ED\u8BA1\u7B97\u65F6\u95F4\uFF0C\u5E76\u964D\u4F4E\u4EFF\u771F\u6C42\u89E3\u8FC7\u7A0B\u4E2D\u7684\u5185\u5B58\u9700\u6C42\u3002\u8BE5\u529F\u80FD\u9002\u7528\u4E8E\u5904\u7406\u4EE5\u4E0B\u5BF9\u8C61:</p><ul><li>\u4E09\u7EF4\u5BF9\u79F0\u6216\u8F74\u5BF9\u79F0\u51E0\u4F55: \u60A8\u53EF\u4EE5\u5927\u5E45\u63D0\u9AD8\u76F8\u540C\u51E0\u4F55\u7684\u6C42\u89E3\u901F\u5EA6</li><li>\u8584\u58C1\u96F6\u4EF6: \u60A8\u53EF\u4EE5\u4F7F\u7528\u5E73\u9762\u5E94\u529B\u5047\u8BBE\u6765\u521B\u5EFA\u4E8C\u7EF4\u6A21\u578B</li><li>\u8F83\u957F\u96F6\u4EF6: \u60A8\u53EF\u4EE5\u4F7F\u7528\u5E73\u9762\u5E94\u53D8\u5EFA\u6A21\u5047\u8BBE\u6765\u521B\u5EFA\u4E8C\u7EF4\u6A21\u578B</li></ul><p>\u901A\u5E38\u7684\u505A\u6CD5\u662F\u63D0\u53D6\u4E09\u7EF4\u51E0\u4F55\u7684\u5173\u952E\u6A2A\u622A\u9762\uFF0C\u521B\u5EFA\u4E8C\u7EF4\u7684\u51E0\u4F55\u5B9E\u4F53\uFF0C\u4E4B\u540E\u901A\u8FC7\u5220\u9664\u5B9E\u4F53\u7684\u65B9\u5F0F\uFF0C\u5C06\u4E09\u7EF4\u51E0\u4F55\u5220\u9664\u3002</p><h2 id="\u5F62\u6210\u8054\u5408\u4F53-\u548C-\u5F62\u6210\u88C5\u914D" tabindex="-1"><a class="header-anchor" href="#\u5F62\u6210\u8054\u5408\u4F53-\u548C-\u5F62\u6210\u88C5\u914D" aria-hidden="true">#</a> \u201C\u5F62\u6210\u8054\u5408\u4F53\u201D\u548C\u201C\u5F62\u6210\u88C5\u914D\u201D</h2><p>\u8FD9\u4E2A\u90E8\u5206\u4E5F\u662F\u6211\u6A21\u62DF\u4E2D\u66FE\u7ECF\u683D\u4E86\u4E00\u4E2A\u8DDF\u5934\u7684\u5730\u65B9\uFF0C\u6709\u4EE5\u4E0B\u7684\u6982\u5FF5\u9700\u8981\u8FDB\u884C\u8BF4\u660E\u548C\u6CE8\u610F:</p><p>\u4E3A\u4E86\u65B9\u4FBF\u5236\u9020\u6210\u54C1\uFF0C\u8BB8\u591A\u4EA7\u54C1\u8BBE\u8BA1\u4F1A\u8FDB\u884C\u7EC4\u4EF6\u88C5\u914D\u3002\u5728 COMSOL Multiphysics<sup>\xAE</sup> \u6A21\u578B\u7684\u51E0\u4F55\u5E8F\u5217\u4E2D\uFF0C\u8FD9\u4E9B\u7EC4\u4EF6\u5BF9\u5E94\u7684\u662F\u51E0\u4F55\u5BF9\u8C61\u3002\u4E0D\u540C\u7684\u51E0\u4F55\u5BF9\u8C61\u7684\u88C5\u914D\u65B9\u5F0F\uFF0C\u5BF9\u6A21\u578B\u662F\u5C24\u4E3A\u91CD\u8981\u7684\u3002</p><p>\u5728 COMSOL Multiphysics \u4E2D\u5EFA\u6A21\u65F6\uFF0C\u60A8\u53EF\u4EE5\u3002\u901A\u8FC7\u4E24\u79CD\u65B9\u5F0F\u6765\u5B9A\u578B\u51E0\u4F55: \u201C\u5F62\u6210\u8054\u5408\u4F53\u201D\u548C\u201C\u5F62\u6210\u88C5\u914D\u201D\u3002\u201C\u5F62\u6210\u8054\u5408\u4F53\u201D\u662F\u9ED8\u8BA4\u9009\u9879\uFF0C\u9002\u7528\u4E8E\u5927\u591A\u6570\u60C5\u51B5\u3002\u4E0D\u8FC7\uFF0C\u5BF9\u4E8E\u53F3\u4E0B\u65B9\u5217\u51FA\u7684\u8FD9\u4E9B\u7279\u5B9A\u60C5\u51B5\uFF0C\u201C\u5F62\u6210\u88C5\u914D\u201D\u7279\u5F81\u5219\u66F4\u4E3A\u9002\u7528\u3002</p><div class="custom-container danger"><p class="custom-container-title">\u8B66\u544A</p><p>\u5728\u6784\u5EFA\u6A21\u578B\u65F6\uFF0C\u5904\u7406\u6216\u5B9A\u578B\u5BF9\u8C61\u96C6\u5408\u7684\u65B9\u6CD5\u975E\u5E38\u91CD\u8981\uFF0C\u5FC5\u987B\u5728\u5256\u5206\u7F51\u683C\u548C\u5B9A\u4E49\u7269\u7406\u573A\u4E4B\u524D\u6267\u884C\u3002</p><p>\u5728\u4E24\u8005\u95F4\u8FDB\u884C\u5207\u6362\u540E\uFF0C\u5FC5\u987B\u8981\u91CD\u65B0\u6784\u5EFA\u5E76\u8BBE\u8BA1\u7F51\u683C! \u8BE5\u64CD\u4F5C\u5BF9\u90E8\u5206\u7269\u7406\u573A\u8BBE\u7F6E\u4E5F\u4F1A\u4EA7\u751F\u5F71\u54CD\uFF0C\u6240\u4EE5\u52A1\u5FC5\u904D\u5386\u68C0\u67E5\u4E00\u904D\u60A8\u6240\u6709\u7684\u7269\u7406\u573A\u8BBE\u7F6E!</p><p>\u8FD9\u662F\u56E0\u4E3A\u51E0\u4F55\u7684\u8868\u793A\u65B9\u5F0F\u4F1A\u5F71\u54CD\u6A21\u578B\u51E0\u4F55\u7684\u7F51\u683C\u5256\u5206\u3002\u800C\u7F51\u683C\u9700\u8981\u5C06\u6A21\u578B\u4E2D\u7684\u5355\u4E2A\u5BF9\u8C61\u8FDE\u63A5\u5728\u4E00\u8D77\u3002\u7531\u4E8E\u7F51\u683C\u4E0E\u7269\u7406\u573A\u7D27\u5BC6\u76F8\u5173\uFF0C\u56E0\u6B64\u8FD9\u53C8\u4F1A\u5F71\u54CD\u6A21\u578B\u7684\u7269\u7406\u573A\u5E76\u6700\u7EC8\u5F71\u54CD\u6C42\u89E3\u7ED3\u679C\u3002</p></div><p>\u201C\u5F62\u6210\u8054\u5408\u4F53\u201D\u548C\u201C\u5F62\u6210\u88C5\u914D\u201D\u65B9\u6CD5\u5747\u7528\u4E8E\u5C06\u591A\u4E2A\u51E0\u4F55\u5BF9\u8C61\u5408\u5E76\u6210\u5355\u4E2A\u5BF9\u8C61\u3002</p><ul><li>\u4F7F\u7528\u201C\u5F62\u6210\u8054\u5408\u4F53\u201D\u65F6\uFF0C\u60A8\u53EF\u4EE5\u5C06\u5BF9\u8C61\u770B\u6210\u662F\u7C98\u5408\u5728\u4E00\u8D77\u7684\u3002\u76F8\u90BB\u7684\u57DF\u901A\u8FC7\u5171\u4EAB\u8FB9\u754C\u8FDE\u63A5\u5728\u4E00\u8D77\u3002\u8F6F\u4EF6\u4F1A\u751F\u6210\u7531\u76F8\u4E92\u8FDE\u63A5\u7684\u57DF\u6784\u6210\u7684\u590D\u5408\u5BF9\u8C61\uFF0C\u5176\u4E2D\u76F8\u90BB\u5B9E\u4F53\u7684\u5171\u4EAB\u8FB9\u754C\u5C06\u57DF\u5206\u9694\u5F00</li><li>\u4F7F\u7528\u201C\u5F62\u6210\u88C5\u914D\u201D\u65F6\uFF0C\u53EF\u4EE5\u5C06\u51E0\u4F55\u5BF9\u8C61\u770B\u4F5C\u5355\u72EC\u7684\u5B9E\u4F53\uFF0C\u5C31\u50CF\u662F\u88C5\u914D\u7684\u96F6\u4EF6\u3002\u8F6F\u4EF6\u4F1A\u591A\u4E2A\u5BF9\u8C61\u7EC4\u5408\u6210\u5355\u4E2A\u5BF9\u8C61\uFF0C\u800C\u5355\u4E2A\u5BF9\u8C61\u4E2D\u7684\u57DF\u96C6\u5408\u5E76\u672A\u76F8\u4E92\u8FDE\u63A5\u3002\u7531\u6B64\u751F\u6210\u7684\u57DF\u4E0D\u76F8\u8FDE\uFF0C\u5E76\u4E14\u4E0D\u4E0E\u76F8\u90BB\u57DF\u5171\u4EAB\u8FB9\u754C\u3002</li></ul><p>\u7B80\u800C\u8A00\u4E4B:</p><ul><li>\u201C\u5F62\u6210\u8054\u5408\u4F53\u201D\u5728\u6574\u4E2A\u57DF\u5185\u521B\u5EFA\u76F8\u4E92\u8FDE\u63A5\u7684\u7F51\u683C</li><li>\u201C\u5F62\u6210\u88C5\u914D\u201D\u521B\u5EFA\u7684\u7F51\u683C\u5219\u4E0D\u76F8\u8FDE\u3002\u9488\u5BF9\u8FD9\u79CD\u60C5\u51B5\uFF0C\u6574\u4E2A\u57DF\u5185\u7684\u7269\u7406\u573A\u901A\u8FC7\u5BF9\u63A5\u89E6\u8FB9\u754C\u81EA\u52A8\u751F\u6210\u4E00\u81F4\u5BF9\u6765\u4FDD\u8BC1\u81EA\u8EAB\u7684\u8FDE\u7EED\u6027\u3002\u5982\u679C\u51E0\u4F55\u5BF9\u8C61\u9700\u8981\u5728\u4EFF\u771F\u4E2D\u8FD0\u52A8\uFF0C\u201C\u5F62\u6210\u88C5\u914D\u201D\u7279\u5F81\u5C24\u5176\u9002\u7528\u3002</li></ul>',23),t=[s];function r(h,c){return l(),p("div",null,t)}const n=i(e,[["render",r],["__file","build.html.vue"]]);export{n as default};
